class Solution {

    /**
     * @param String[][] $access_times
     * @return String[]
     */
    function findHighAccessEmployees($access_times) {
        $employeeAccess = [];
        foreach ($access_times as $entry) {
            $employeeAccess[$entry[0]][] = intval($entry[1]);
        }

        $result = [];
        foreach ($employeeAccess as $employee => $times) {
            sort($times);
            for ($i = 0; $i < count($times); ++$i) {
                $count = 1;
                for ($j = $i + 1; $j < count($times) && $times[$j] - $times[$i] < 100; ++$j) {
                    if ($times[$j] / 100 == $times[$i] / 100 || ($times[$j] - $times[$i]) <= 59) {
                        ++$count;
                    }
                }
                if ($count >= 3) {
                    $result[] = $employee;
                    break;
                }
            }
        }

        return $result;
    }
}
